INSERT INTO `course` VALUES ('vsQz6xVD', 'PHP课程企业实战课程', 'React — 大厂前端必备的技能点，本课程将带你系统学习 React 17 的完整技术体系，并结合 TypeScript 开发热门业务应用，实现对于框架的深度掌握，助你提升硬实力，快人一步进大厂。', 71, 123.00, 'https://douding-course.oss-cn-beijing.aliyuncs.com/course/4MYfgGg63CaS0qQAqeYKoo.jpg', '3', 'F', 'P', 1, 1, '2021-08-04 10:29:15.000', '2021-08-23 11:20:53.200', 'KU5kizJz');
