INSERT INTO `course_content` VALUES ('a2UqvQqI', '<p><img src=\"http://127.0.0.1:9000/file/f/course/OK82AzTe.jpeg	\" style=\"width: 400px;\">这是测试的内容啊</p>');
INSERT INTO `course_content` VALUES ('EOFErD7x', '');
INSERT INTO `course_content` VALUES ('EQaDRgc9', '<p><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px;\">本课程为Vue2.0版本，Vue是渐进式JavaScript框架，并且易用、灵活和高效的。进两年Vue框架的使用是最多的了。从百度指数与微信指数中不难看到。本课程主要讲解的内容为：环境搭建、基本指令、组件的使用、数据交互、网络请求、路由处理、第三方常用组件库同时最后添加项目，用来熟悉以上知识点。基本涵盖了API中大部分的常用知识点。</span><br style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px;\"><br style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px;\"><span style=\"color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px;\">　　本课程学习前，建议有一定的HTML、CSS、JS基础。并且，最好掌握了Webpack构建工具与ES6的基本语法。学起来会更加轻松。后续会更新关于Vue在项目中的最佳实践相关的课程。</span><br></p>');
INSERT INTO `course_content` VALUES ('vsQz6xVD', '<p><span style=\"color: rgb(85, 85, 85); font-family: -apple-system, system-ui, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; font-size: 16px; background-color: rgb(248, 249, 250);\">React — 大厂前端必</span><img src=\"data:image/png;base64,\" style=\"width: 662px;\" data-filename=\"截屏2022-04-15 上午11.38.44.png\"></p>');
